import * as React from 'react';
import { Text, View, Button, Alert, Image } from 'react-native';
import { createStackNavigator, CreateStackNavigator } from '@react-navigation/stack';
import { BottomTabView, createBottomTabNavigator, CreateBottomTagNavigator } from '@react-navigation/bottom-tabs';
import AppButton from '../components/AppButton';
import { AuthContext } from '../components/context';

// Stock Tab Icons
import { Entypo } from '@expo/vector-icons'; 
import { linear } from 'react-native/Libraries/Animated/src/Easing';
import { ScrollView, TouchableOpacity } from 'react-native-gesture-handler';



// ACTUAL TAB NAVIGATOR
const BottomTab = createBottomTabNavigator();
export default function BottomTabNavigator() {

  return(
    <BottomTab.Navigator>
      <BottomTab.Screen
        name="Breathe"
        component={BreatheStackScreen}
        options={{
          tabBarIcon: () => <TabBarIcon name="air" />
        }}
      />
      <BottomTab.Screen 
        name="Meditate"
        component={MeditateStackScreen}
        options={{
          tabBarIcon: () => <TabBarIcon name="dots-two-horizontal" />
        }}
      />
      <BottomTab.Screen 
        name="Favorite"
        component={FavoriteStackScreen}
        options={{
          tabBarIcon: () => <TabBarIcon name="heart-outlined" />
        }}
      />
      <BottomTab.Screen 
        name="Profile"
        component={ProfileStackScreen}
        options={{
          tabBarIcon: () => <TabBarIcon name="user" />
        }}
      />
    </BottomTab.Navigator>
  )
}

function TabBarIcon({name}) {
  return <Entypo name={name} size={24} color="black" />
}







// STACK NAVIGATORS
const BreatheStack = createStackNavigator();
function BreatheStackScreen() {
  return (
    <BreatheStack.Navigator>
      <BreatheStack.Screen name="Breathe" component={BreatheScreen} />
    </BreatheStack.Navigator>
  )
}

const MeditateStack = createStackNavigator();
function MeditateStackScreen() {
  return (
    <MeditateStack.Navigator>
      <MeditateStack.Screen name="Meditate" component={MeditateScreen} />
    </MeditateStack.Navigator>
  )
}

const FavoriteStack = createStackNavigator();
function FavoriteStackScreen() {
  return (
    <FavoriteStack.Navigator>
      <FavoriteStack.Screen name="Favorite" component={FavoriteScreen} />
    </FavoriteStack.Navigator>
  )
}

const ProfileStack = createStackNavigator();
function ProfileStackScreen() {
  return(
    <ProfileStack.Navigator>
      <ProfileStack.Screen name="Profile" component={ProfileScreen} />
    </ProfileStack.Navigator>
  )
}








// ACTUAL SCREENS
function BreatheScreen() {
  return(
    <ScrollView>
      <Text>Breathe SCREEN</Text>
      <View style={{padding: 20, justifyContent: "center", alignItems: "center"}}>
        <Image source={require('../assets/memoir-logo.png')}/>
      </View>
    </ScrollView>
  )
}

function MeditateScreen() {
  return (
    <View>
      <Text>Meditate SCREEN HERE YO</Text>
      <View style={{flexDirection: "row", padding: 20}}>        
        <View style={{backgroundColor: "purple", flex: 1, height:200, borderRadius: 10 }}/>
      </View>
      <Button title="BUTTON" onPress={() => Alert.alert('button pressed!')} />
    </View>
  )
}

function FavoriteScreen() {
  return (
    <ScrollView>
      <Text style={{textAlign: "center", fontSize: 23}}>Favorites</Text>
      <View style={{flex: 1, flexDirection: "column", justifyContent: "center", alignContent: "stretch", padding: 20}}>
        <View style={{borderWidth: 1, width: 200}}>
          <Image source={require("../assets/favorites-screen/jungle-green.png")}/>
          <Text>Box Breathing</Text>
          <Text>4 Second Box Pattern</Text>
        </View>
        <View>
          <Image source={require('../assets/favorites-screen/forest-orange.png')}/>
          <Text>Ride the Wave</Text>
          <Text>Slow Deep Breathing</Text>
        </View>
        <View style={{backgroundColor: "lightgreen", height: 100, borderRadius: 10 }}/>
        <View style={{backgroundColor: "indigo", height: 100, borderRadius: 10 }}/>
        <View style={{backgroundColor: "lightblue", height: 100, borderRadius: 10 }}/>
        <View style={{backgroundColor: "orange", height: 100, borderRadius: 10 }}/>
        <View style={{backgroundColor: "pink", height: 100, borderRadius: 10 }}/>
        <View style={{backgroundColor: "indianred", height: 100, borderRadius: 10 }}><Button title="RED"></Button></View>
      </View>
    </ScrollView>
  )
}

function ProfileScreen() {
  const { signOut } = React.useContext(AuthContext);
  return (
    <View>
      <Text>User's Profile here</Text>
      <Image source={require('../assets/favicon.png')} />
      <View style={{padding: 20, flexDirection:"column", alignItems: "center"}}>        
        <Image source={require('../assets/memoir-logo.png')}/>
        <View style={{backgroundColor: "orange", width: 100, height: 100, borderRadius: 10 }}/>

        <TouchableOpacity style={{backgroundColor: "crimson", height: 30, width: 80, justifyContent: "center", alignItems: "center", borderRadius: 7}} onPress={() => {signOut()}}>
          <Text>Sign Out</Text>
        </TouchableOpacity>

      </View>
    </View>
  )
}
